import React, { Component } from "react";
import { Button, Col, Card, CardBody, Modal, ModalHeader } from "reactstrap";
import TableComponent from './positionTable';
import UserModal from './positionModal';
import Translate from "../../../Translate";



class UserContainer extends Component {
    constructor(props) {
        super(props)
        // this.props.getUsers()
        this.props.getPositions()
    }
    toggle() {
        this.props.userModal("add",!this.props.modal.add)
    }

    render() {
        return(
            <Col sm="12">
                <Card>
                    <CardBody>
                        <Button
                            color="primary"
                            type="button"
                            className="btn btn-raised btn-danger my-2 shadow-z-2"
                            onClick={()=>this.toggle()}
                        >
                            <Translate name="add"/>
                        </Button>{" "}
                        <TableComponent {...this.props}/>
                    </CardBody>
                </Card>
                <Modal isOpen={this.props.modal.add} toggle={()=>this.toggle()}  size="md">
                    <ModalHeader toggle={()=>this.toggle()}><Translate name="addContact"/></ModalHeader>
                    <UserModal {...this.props}/>
                </Modal>

            </Col>
        )
    }
}


export default UserContainer;
